#define SAMPLE_RATE 8000

// Definisikan pin untuk tombol dan LED
#define BUTTON1_PIN 2
#define BUTTON2_PIN 3 // mega 4 5
#define LED_PIN_4 4
#define LED_PIN_5 5
#define LED_PIN_6 6

void blinkLEDs() {
  for (int i = 0; i < 2; i++) {
    // Nyalakan semua LED
    PORTD |= (1 << LED_PIN_4) | (1 << LED_PIN_5) | (1 << LED_PIN_6);
    _delay_ms(200);
    
    // Matikan semua LED
    PORTD &= ~((1 << LED_PIN_4) | (1 << LED_PIN_5) | (1 << LED_PIN_6));
    _delay_ms(200);
  }
}

void updateLEDs(uint8_t pressCount) {
  // Matikan semua LED
  PORTD &= ~((1 << LED_PIN_4) | (1 << LED_PIN_5) | (1 << LED_PIN_6));

  // Nyalakan LED sesuai jumlah penekanan
  if (pressCount == 1) {
    PORTD |= (1 << LED_PIN_4);  // Nyalakan LED D4
  } else if (pressCount == 2) {
    PORTD |= (1 << LED_PIN_5);  // Nyalakan LED D5
  } else if (pressCount == 3) {
    PORTD |= (1 << LED_PIN_6);  // Nyalakan LED D6
  }
}

