unsigned char const *sounddata_data = 0;
int sounddata_length = 0;
volatile uint16_t sample;
uint8_t lastSample;

void playAudio(unsigned char const *data, int length) {
  sounddata_data = data;
  sounddata_length = length;

  // Set pin as output
  DDRB |= _BV(PB3);

  // Set up Timer 2 to do pulse width modulation on the speaker pin
  ASSR &= ~(_BV(EXCLK) | _BV(AS2));
  TCCR2A |= _BV(WGM21) | _BV(WGM20);
  TCCR2B &= ~_BV(WGM22);
  TCCR2A = (TCCR2A | _BV(COM2A1)) & ~_BV(COM2A0);
  TCCR2A &= ~(_BV(COM2B1) | _BV(COM2B0));
  TCCR2B = (TCCR2B & ~(_BV(CS12) | _BV(CS11))) | _BV(CS10);
  OCR2A = pgm_read_byte(&sounddata_data[0]);

  // Set up Timer 1 to send a sample every interrupt
  cli();
  TCCR1B = (TCCR1B & ~_BV(WGM13)) | _BV(WGM12);
  TCCR1A = TCCR1A & ~(_BV(WGM11) | _BV(WGM10));
  TCCR1B = (TCCR1B & ~(_BV(CS12) | _BV(CS11))) | _BV(CS10);
  OCR1A = F_CPU / SAMPLE_RATE;
  TIMSK1 |= _BV(OCIE1A);
  lastSample = pgm_read_byte(&sounddata_data[sounddata_length - 1]);
  sample = 0;
  sei();
}

ISR(TIMER1_COMPA_vect) {
  if (sample >= sounddata_length) {
    if (sample == sounddata_length + lastSample) {
      TIMSK1 &= ~_BV(OCIE1A);
      TCCR1B &= ~_BV(CS10);
      TCCR2B &= ~_BV(CS10);
      PORTB &= ~_BV(PB3);
    }
    else{
      OCR2A = sounddata_length + lastSample - sample;
    }
  }
  else{
    OCR2A = pgm_read_byte(&sounddata_data[sample]);
  }
    ++sample;
}

int main(void) {
  // Set pin D2 dan D3 sebagai input (Button)
  DDRD &= ~((1 << BUTTON1_PIN) | (1 << BUTTON2_PIN));  // Clear bit untuk mengatur sebagai input
  PORTD |= (1 << BUTTON1_PIN) | (1 << BUTTON2_PIN);    // Aktifkan pull-up resistor internal

  // Set pin D4, D5, dan D6 sebagai output (LED)
  DDRD |= (1 << LED_PIN_4) | (1 << LED_PIN_5) | (1 << LED_PIN_6);  // Set bits di DDRD register untuk output

  // Variabel untuk melacak status LED dan tombol
  bool button1State = false;
  bool lastButton1State = false;
  bool button2State = false;
  bool lastButton2State = false;
  uint8_t pressCount = 1;  // Mulai dengan nilai 1 untuk menyalakan LED pertama

  // Variabel untuk melacak LED yang aktif terakhir kali
  uint8_t lastLED = LED_PIN_4;

  // Baca nilai pressCount dari EEPROM
  pressCount = eeprom_read_byte((uint8_t*)0);

  // Pastikan pressCount dalam rentang yang valid
  if (pressCount < 1 || pressCount > 3) {
    pressCount = 1;
  }

  // Update LED sesuai dengan nilai pressCount yang dibaca dari EEPROM
  updateLEDs(pressCount);

  while (1) {
    // Baca status tombol
    button1State = !(PIND & (1 << BUTTON1_PIN));  // Tombol aktif rendah
    button2State = !(PIND & (1 << BUTTON2_PIN));  // Tombol aktif rendah

    // Periksa apakah tombol pertama ditekan (transisi dari tidak ditekan ke ditekan)
    if (button1State != lastButton1State) {
      if (button1State) {
        // Tombol pertama ditekan, tambahkan jumlah penekanan
        pressCount++;
        
        // Reset jika penekanan lebih dari 3
        if (pressCount > 3) {
          pressCount = 1;
        }

        // Update LED sesuai jumlah penekanan dan simpan yang terakhir kali diaktifkan
        updateLEDs(pressCount);

        // Simpan nilai pressCount ke EEPROM
        eeprom_update_byte((uint8_t*)0, pressCount);

        // Tentukan LED terakhir yang diaktifkan
        // if (pressCount == 1) {
        //   lastLED = LED_PIN_4;
        // } else if (pressCount == 2) {
        //   lastLED = LED_PIN_5;
        // } else if (pressCount == 3) {
        //   lastLED = LED_PIN_6;
        // }
      }
      // Debounce delay
      _delay_ms(50);
    }

    // Periksa apakah tombol kedua ditekan (transisi dari tidak ditekan ke ditekan)
    if (button2State != lastButton2State) {
      if (button2State) {
        // Tombol kedua ditekan, semua LED berkedip 3 kali
        blinkLEDs();

        pressCount = eeprom_read_byte((uint8_t*)0);

        if (pressCount < 1 || pressCount > 3) {
          pressCount = 1;
        }
        
        // // Setelah berkedip, nyalakan kembali LED yang terakhir kali di-set
        // PORTD |= (1 << lastLED);
        // if (pressCount == 1) {
        //   playAudio(audio_id, sizeof(audio_id));
        // } else if (pressCount == 2) {
        //   playAudio(audio_en, sizeof(audio_en));
        // } else if (pressCount == 3) {
        //   playAudio(audio_en, sizeof(audio_en));
        // }

        updateLEDs(pressCount);

        if(pressCount == 1){
          playAudio(audio_jp, sizeof(audio_jp));
        }
        else if(pressCount == 2){
          playAudio(audio_en, sizeof(audio_en));
        }

        else if(pressCount == 3){
          playAudio(audio_id, sizeof(audio_id));
        }
      }
      // Debounce delay
      _delay_ms(50);
    }

    // Simpan status tombol untuk perbandingan pada loop berikutnya
    lastButton1State = button1State;
    lastButton2State = button2State;
  }

  return 0;
}
